--
-- Name: findvertex(double precision, double precision); Type: FUNCTION; Schema: public; Owner: root
--

CREATE FUNCTION public.findvertex(x double precision, y double precision) RETURNS integer
    LANGUAGE sql
    AS $$
  SELECT n.id 
FROM (SELECT ST_SetSRID(public.ST_Point(x, y),
4326) As geom) As b LEFT JOIN road_network_vertices As n
ON ST_DWithin(ST_Transform(n.geom_vertex,4326), st_transform(b.geom,4326), 1000)
ORDER BY ST_Distance(ST_Transform(n.geom_vertex,4326), b.geom)
LIMIT 1;
$$;


ALTER FUNCTION public.findvertex(x double precision, y double precision) OWNER TO root;

